INSERT INTO `ecs_article` (`article_id`, `cat_id`, `title`, `content`, `author`, `author_email`, `keywords`, `article_type`, `is_open`, `add_time`, `file_url`, `open_type`, `link`, `description`, `is_recommend`, `article_pic`, `is_index`) VALUES
(6, -1, '注册协议', '<p>本网站不支持在线购物，如果您看中商品，直接联系公司客服，感谢您的关注</p>', '', '', '', 0, 1, 1536835791, '', 0, 'http://', '', '0', '', 0),
(101, 9, '联系我们', '<p>&nbsp;网站测试中。。。。。。</p>', '', '', '', 0, 1, 1593935001, '', 0, 'http://', '', '0', NULL, 0),
(80, -1, '关于我们', '<p>&nbsp;网站测试调整中。。。本网站不支持在线购物，仅为商品展示。</p>', '', '', '', 0, 1, 1536835791, '', 0, 'http://', '', '0', '', 0),
(99, 5, '订购方式', '<p>&nbsp;<span style=\"color: rgb(85, 85, 85); font-family: &quot;microsoft yahei&quot;;\">本网站，不支持在线购买，如果看中商品，可联系公司客服。确认商品后，一个电话就可以搞定。</span></p>', '', '', '', 0, 1, 1593934388, '', 0, 'http://', '', '0', '', 0),
(98, 7, '配送区域', '<p>&nbsp;本网站，不支持在线购买，如果看中商品，可联系公司客服。</p>\r\n<p>上海市内免费送货，外地为顺丰快递或德邦物流。</p>', '', '', '', 0, 1, 1593933971, '', 0, 'http://', '', '0', NULL, 0),
(97, 7, '支付方式', '<p>&nbsp;本网站，不支持在线购买，如果看中商品，可联系公司客服，支付方式为：公对公转账。</p>', '', '', '', 0, 1, 1593933887, '', 0, 'http://', '', '0', NULL, 0),
(94, 10, '免责申明', '<p>网站测试中。。。。网上信息很多不对，联系方式也不对。最近网站公司还在调整中，，，如果问题，敬请原谅！</p>\r\n<p>本网站商品，仅供展示，不支持在线购物，网站上不产生任何费用</p>\r\n<p>关于商品价格：展示商品价格，仅供参考，实际价格请联系您的客服经理。</p>\r\n<p>关于商品内容：商品信息大部分由品牌方或供应商提供，部分产品公司拍摄，部分产品可能源于网络，如果图片侵权，请随时联系我们删除，021-58950818，</p>\r\n<p>&nbsp;</p>', '', '', '', 1, 1, 1593835131, '', 0, 'http://', '申明', '0', '', 0),
